import './App.css'; 



function Home() {
  return (
    <main>
      <nav>
        <ul>
          <li>Home</li>
          <li>Apps</li>
          <li>Websites</li>
          <li>Photography</li>
        </ul>
      </nav>
      <div className="Animation">
      <video autoPlay loop muted style={{ width: '100%', height: '100%' }}>
          <source src="Fire.mp4" type="video/mp4" />
          Your browser does not support the video tag.
      </video>
      </div>
    </main>
  );
}

export default Home;
